import './App.scss';
import Card from './components/card/card';
import React,{useState, useEffect} from 'react';




const App = () =>  {
  const [data, setData] = useState([]);

  useEffect(() => {
    getCardData()
        .then( (data)=> {
          setData(data)
        })
  }, []);
  
  return (
    <main className="main">
      <description className="description">Похожие объвления</description>
      <div className="App">
        <Card/>
      </div>
      <div className="showMore">
        <span className="text">Показать еще</span>
        <span className="expand"></span>
      </div>
    </main>
  );
}

export default App;
